{
  "info": {
    "title": "Supabase Plugin with API Key",
    "version": "1.0.0"
  },
  "servers": [
    {
      "url": "https://wcebawczidhooqpvnsug.supabase.co",
      "description": "Supabase with service_role key"
    }
  ],
  "paths": {
    "/rest/v1/{table}": {
      "post": {
        "summary": "Insert a record",
        "operationId": "createRecord",
        "parameters": [
          {
            "name": "table",
            "in": "path",
            "required": true,
            "schema": {
              "type": "string"
            }
          }
        ],
        "requestBody": {
          "required": true,
          "content": {
            "application/json": {
              "schema": {
                "type": "object" }
            }
          }
        },
        "responses": {
          "200": {
            "description": "Successful insert" }
        },
        "security": [
          { "apikey": [] }
        ]
      }
    }
  },
  "components": {
    "securitySchemes": {
      "apikey": {
        "type": "apiKey",
        "in": "header",
        "name": "apikey" }
    }
  },
  "security": [
    { "apikey": [] }
  ]
